import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View ,ImageBackground, Button, Alert, Modal } from 'react-native';

export default function App() {
  const image={URL:"https://reactjs.org/logo-og.png"};
  // const imagesrc2={"Aquaman.jpg"};
  return (
    <View style={styles.container}>
      <ImageBackground source={image} resizeMode="cover" style={styles.image}>
        <Text style={styles.text}>Open up App.js to start working on your app!</Text>
        <View >
          <Button title="hello" onPress={() => Alert.alert('Simple Button pressed')} style={outerHeight=50}></Button>
        </View>
        <StatusBar 
        animated={true}
        backgroundColor="#61dafb"></StatusBar>
        </ImageBackground>

    <View>
      <Modal 
          animationType="slide"
          transparent={true}
          visible={modalVisible}
        >
          <View style={styles.centeredView}>
            <View style={styles.modalView}>
              <Text style={styles.modalText}>Hello World!</Text>
            </View>
          </View>
        </Modal>
    </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  image: {
    flex: 1,
    justifyContent: "center"
  },
  button:{
    flex:1,
    alignSelf:'center',
    fontSize:40,
  },
  text:{
    color: "white",
    fontSize: 42,
    lineHeight: 84,
    fontWeight: "bold",
    textAlign: "center",
    backgroundColor: "#000000c0"
  },
  centeredView: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
    marginTop: 22
  },
  modalView: {
    margin: 20,
    backgroundColor: "white",
    borderRadius: 20,
    padding: 35,
    alignItems: "center",
    shadowColor: "#000",
    shadowOffset: {
      width: 0,
      height: 2
  }},
});
